import React from 'react';

const SareeList = ({ sarees, addToCart }) => {
    return (
        <div className="saree-list">
            {sarees.map(saree => (
                <div key={saree.id} className="saree-item">
                    <img src={saree.imag} alt={saree.name} className="saree-image" />
                    <p>{saree.name}</p>
                    <p className="price">${saree.price}</p>
                    <button onClick={() => addToCart(saree)}>Add to Cart</button>
                </div>
            ))}
        </div>
    );
};

export default SareeList;
